import './Navbar.css';
import {Link} from "react-router-dom";

function Navbar() {
  return (
    <div className="navbar">
    {/* the logo secton */}
    <div className="navbar_logo">
        <h2>WEBBASE LEARNING APS</h2>
    </div>
  
   {/* the links session */}
   <ul className="navbar_links">
        <li>
          
            <Link to="/cart">
              <i className="fas fa-shopping-cart"></i>
                Characters
                <span className="cartlogo_badge">0</span>
            </Link>
        </li>

        <li>
            <Link to="/">
              {/* icon */}
                Episode
            </Link>
        </li>
        <li>
            <Link to="/">
              {/* icon */}
                Quotes
            </Link>
        </li>
        <li>
            <Link to="/">
              {/* icon */}
                Deaths
            </Link>
        </li>
   </ul>

   
</div>
  );
}

export default Navbar;
